import Link from "next/link"
import Head from "next/head"
import logo from "../assets/exam.png"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <Head>
            <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet" />
        </Head>
            <div className="searchMain">

            </div>
            <Link href={loggedIn ? '/liked' : 'login'}>
                <a className="heart">
                    <i class="material-icons">{loggedIn ? "favorite" : "favorite_border"}</i>
                </a>
            </Link>
            <Link href={loggedIn ? '/upload' : 'login'}>
                <a className='flex'>
                    <i class="material-icons">file_upload</i>
                </a>
            </Link>
            {loggedIn ? <Link href={`/user/${userID}`}><a>{accountName}</a></Link> : null}
            {!loggedIn ? <Link href="/login"><a>Login</a></Link> : null}
            {!loggedIn ? <Link href="/signup"><a>Sign up</a></Link> : null}
    <style jsx>{`
        .main {
            position: relative;
            display: flex;
            flex-direction: row;
            justify-content: flex-end;
            align-items: center;
            height: 5rem;
            background: rgb(0,0,0);
            padding: 0 2rem 0 2rem;
            border-bottom-left-radius: 25px;
            border-bottom-right-radius: 25px
        }

        .searchMain {
            position: absolute;
            left: auto;
            right: auto:
            top:auto;
            bottom: auto
        }

        .logo {
            position: absolute;
            top: .65rem;
            left: .5rem;
            width: 32px;
            height: 32px
        }

        a {
            text-decoration: none;
            color: rgb(255,255,255);
            font-size: 1.4rem;
            margin: 0 .4rem 0 .4rem;
            letter-spacing: .09rem
        }

        a:hover {
            color: rgb(222, 218, 217);
        }

        .flex {
            display: flex;
            width: 24px;
        }

        .heart {
            display: flex;
            width: 24px;
            color: rgb(240, 79, 79);
        }

        .heart:hover {
            color: rgb(207, 58, 58)
        }
    `}</style>
    </div>
)
